import React from 'react';
import './App.css';
import { Button } from '@material-ui/core';

function RandButton() {

    function Roll(Number) {
        const min = 1;
        const max = Number;
        const rand = min + Math.random() * (max - min);
        console.log(rand);
    }

    return (
        <div className="Map">
            <Button variant="outlined" onClick={Roll}>
                Click me!
            </Button>
        </div>
    );
}

export default RandButton;
